import Header from "../components/header";
import Slideshow from "../components/slideshow";
import QuienesSomos from "./quienesSomos";
import ClubesBoard from "../components/ClubesBoard";
import Footer from "../components/Footer";
import React from "react";
import EventsMain from "./events/eventsMain";
const Home=()=>{
    return <div>
        <Slideshow/>
        <ClubesBoard/>
        <div className="mapa">
            <iframe className="iframe" height="500"
                    src="https://www.openstreetmap.org/export/embed.html?bbox=-82.55264282226564%2C22.971353928229505%2C-82.19009399414064%2C23.200960808078566&layer=mapnik"></iframe>

            <iframe className="iframe" width="425" height="350" 
                    src="https://www.openstreetmap.org/export/embed.html?bbox=-78.49013686180116%2C-0.21133613349101213%2C-78.48818957805635%2C-0.2096919504628004&amp;layer=mapnik"
                    style="border: 1px solid black"></iframe>
            <br/><small><a href="https://www.openstreetmap.org/#map=19/-0.21051/-78.48916">Ver mapa m√°s
            grande</a></small>
        </div>
    </div>
}
export default Home
